import React from "react";
import "./../styles.scss";
import { Link } from "react-router-dom";

class HeaderForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="row">
        <div className="p-header">
          <div className="col-sm-3">
            <img
              src={require("./../../../../images/terralogic.png")}
              className="p-picture-background"
              alt="img"
            />
          </div>
          <div className="col-sm-2 pull-right">
            <Link to="/profile" className="p-link">
              PROFILE
            </Link>

            <ul class="sub-icon1 list">
              <h3>Recently added items(2)</h3>
              <div class="shopping_cart">
                <div class="cart_box">
                  <div class="message">
                    <div class="alert-close"> </div>
                    <div class="list_img">
                      <img src="images/14.jpg" class="img-responsive" alt="" />
                    </div>
                    <div class="list_desc">
                      <h4>
                        <a href="/#">velit esse molestie</a>
                      </h4>
                      1 x<span class="actual">$12.00</span>
                    </div>
                    <div class="clearfix" />
                  </div>
                </div>
              </div>
            </ul>
          </div>
        </div>
      </div>
    );
  }
}

export default HeaderForm;
